import {connect} from "react-redux";
import React from 'react'


function PostList({allPosts}) {

    return (
        <ul>
            {allPosts.map(post => (
                <Post key={post.id} {...post}/>
            ))}
        </ul>
    );
}

export default connect()(PostList)
